<script type="text/babel">

    export default {
        name: "HbIcon",
        computed: {
            icon(){
                if(this.mdiIcon){
                    return this.mdiIcon;
                }
                else if(this.$slots.default){
                    return this.$slots.default[0].text.trim();
                }
                else {
                    return '';
                }
            },
            currentColor(){
                if(this.hover && this.hoverColor){
                    return this.hoverColor;
                }
                else if(this.hover && !this.hoverColor && !this.color){
                    return '#101318';
                }
                else if(this.activeStateOff){
                    return this.iconColor;
                }
                else if(this.toggle && this.activeColor){
                    return this.activeColor;
                }
                else if(this.toggle && !this.activeColor){
                    return '#101318';
                }
                else {
                    return this.iconColor;
                }
            },
            iconColor(){
                if(this.color === 'primary'){
                    return '#00848E';
                }
                else if(this.color === 'caution'){
                    return '#FFD600';
                }
                else if(this.color === 'warning' || this.color === 'error'){
                    return '#FB4C4C';
                }
                else if(this.color === 'success'){
                    return '#02AD0F';
                }
                else if(this.color === 'default'){
                    return '#637381';
                }
                else if(this.color){
                    return this.color;
                } else {
                    return '#637381';
                }
            },
            size(){
                if(this.small){
                    return 16;
                }
                else {
                    return 24;
                }
            }
        },
        props: {
            small: {
                type: Boolean,
                default: false
            },
            activeStateOff: {
                type: Boolean,
                default: false
            },
            color:{
                type: String
            },
            activeColor:{
                type: String
            },
            hoverColor:{
                type: String
            },
            hover:{
                type: Boolean,
                default: false
            },
            toggle:{
                type: Boolean,
                default: false
            },
            mdiIcon:{
                type: String
            }
        },
    }
</script>

